import React, { Component } from 'react'

class ListContacts extends Component {
  render () {
    console.log(this.props)
    return (
      <ol className='contact-list'>
        <li>{this.props.contacts.map((contact) => (
          <li>
            {contact.name}
          </li>
        ))}</li>
      </ol>
    )
  }

}

export default ListContacts
